import React, {Component} from 'react';
import '../CSS/Info.css';
import AddWindow from './AddWindow';


class Info extends Component {
    state = {
        seen: false
    };

    toggleAdd = () => {
        this.setState({
            seen: true
        });
        console.log(this.state.seen);
    };

    render() {
        return(
            <div>
                <button className="add-meds" onClick={this.toggleAdd}>Add</button>
                <div>{this.state.seen ? <AddWindow /> : null}</div>
                <table className="medication-info">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Amount</th>
                            <th>9:00</th>
                            <th>12:00</th>
                            <th>15:00</th>
                            <th>20:00</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Aspirin</td>
                            <td>2x75mg</td>
                            <td>75mg</td>
                            <td></td>
                            <td></td>
                            <td>75mg</td>
                        </tr>
                        <tr>
                            <td>Amoxicillum</td>
                            <td>1x500mg</td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td>500mg</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Info;
